import React from "react";
import AppLayout from "../components/AppLayout";
import LangdingLayout from "../components/LangdingLayout";

const Home = () => {
  return (
    <LangdingLayout>
      <div>Hello intro!</div>
      <div>
        <p>새로운 분야에 도전하거나 직업에 대한 전문성을 키우고 싶은 분들을 위한</p>
      </div>
    </LangdingLayout>
  );
};

export default Home;
